INSERT INTO `tbl_insta1` (`insta_id`, `insta_text1`, `insta_date`, `regdate`) VALUES
	('1000_sung_hwan', '#혼밥 #혼밥스타그램 #부평기사식당 #돼지불백 #폭염 #잘먹고 #잘자고 #잘싸고 #버티자', '2018년 7월 31일', '2018-07-31 14:08:44'),
	('99jhyun0103', 'JMT❣️매일 가야징#마카나이 #아이폰8 #혼밥 #혼밥스타그램 #알바끝난후 #라멘', '2018년 7월 31일', '2018-07-31 14:09:09'),
	('byengddong_ee', '퇴근후 오랜만에 초밥먹기🌟', '2018년 7월 31일', '2018-07-31 14:08:22'),
	('cooking_jachui', '#20180731\n저번에 먹고남은 새우로 감바스만들기~\n#자취스타그램#자취요리그램\n#오늘뭐먹지 #자취생요리#자취한끼#자취밥상#요리스타그램#요리#혼밥스타그램#혼밥#홈쿡스타그램#쿠킹스타그램#일상#cooking#감바스알아히요#감바스#간식#새우요리', '2018년 7월 31일', '2018-07-31 14:08:41'),
	('eunyoung.ida', '#소불고기_호박잎쌈밥#매실장아찌_고추장무침 .\n.\n어제랑 같은 메뉴.\n예쁘게 말고 예쁘게 써는 건 어렵구나.\n입에 들어가면 똑같은 거니까... 괜찮...😢\n.\n.\n#요리일기 #먹스타그램 #쿡스타그램 #자취스타그램 #자취밥상 #자취요리 #소불고기 #호박잎 #쌈밥 #혼밥 #혼밥스타그램 #어제와같은메뉴 #냠냠', '2018년 7월 31일', '2018-07-31 14:08:53'),
	('gilhyanghyeon', '#삼겹살간장볶음\n.\n<재료>\n삼겹살 2줄, 편마늘 약간, 양파(소) 1개, 대파 약간, 엄마표 맛간장 3T, 맛술 2T, 굴소스 약간, 후추 약간\n.\n간단하게 먹으려고 했는데\n한상차림 되어버림 😅\n로메인 상추 아삭아삭하니\n맛있넴 😋\n.\n.\n#자취 #자취요리 #자취생요리 #요리스타그램 #혼밥 #혼밥스타그램 #요리하는남자 #집밥 #daily #food #홈쿡 #자취스타그램 #데일리 #혼술 #선팔 #맞팔 #소통\n#엄마가해준 #파김치가 #세상에서 #제일 #맛있어 💕', '2018년 7월 31일', '2018-07-31 14:09:28'),
	('gold_dia', '죽이라 그런지 많이 먹어도 금방 허기가 지나보다 자꾸 빵빵빵 하면서 빵 을 찾는다😭\n총을 쏘고 싶은거니😅\n울아들 안쓰러워라😭\n\n#문어죽 #죽\n\n#집밥스타그램#저녁#마이홈#인테리어그램#홈스타일링#신혼집꾸미기#인테리어#인테리어스타그램#우리집#꿀하우스#데일리#데일리그램#일상#일상스타그램#하우스그램#온라인집들이#간식#식물스타그램#플랜테리어#홈스타그램#홈데코#신혼집인테리어#야식#집스타그램#건강식#아내의식탁#혼밥스타그램#혼밥', '2018년 7월 31일', '2018-07-31 14:09:11'),
	('im_ms.kim', '카페인 놓고 #작업준비 겟 셋 레디\n.\n.\n.\n#일상 #소통 #좋아요 #팔로우 #맞팔해요 #선팔하면맞팔 #맛집 #카페 #요리스타그램 #친스타그램 #혼밥 #혼밥스타그램 #운동 #운동하는여자 #백수 #백수스타그램 #ootd #데일리룩 #패션스타그램 #주얼리 #금속공예 #커피 #카페인충전 #밤샘작업', '2018년 7월 31일', '2018-07-31 14:08:47'),
	('jamiejin0121', '#분식#김밥천국#경산#비빔국수#혼밥#혼밥스타그램#맛집#경산맛집#맛집탐방#맛스타그램#먹스타그램#일상#데일리#소통\n대마도 다녀와서 매콤한 비빔국수\n그렇다!난 한국인인 것이다!', '2018년 7월 31일', '2018-07-31 14:08:39'),
